import React from "react";
import "../../homepage/style/homeStyle.scss";
import BackHome from "./back";
import UserId from "./userInformation";

const HomePage = () => {
    return (
        <>
            <BackHome />
            <div className="container">
                <div className="header">
                    <UserId />
                </div>
            </div>
        </>
    );
};
